import React, { useState, useRef, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Header.css";

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [user, setUser] = useState(null); // null = niezalogowany
  const [accountMenuOpen, setAccountMenuOpen] = useState(false);
  const navRef = useRef(null);
  const hamburgerRef = useRef(null);
  const accountRef = useRef(null);
  const navigate = useNavigate();

  // ZamkniÄ™cie menu po klikniÄ™ciu poza nim
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (
        isOpen &&
        navRef.current &&
        !navRef.current.contains(event.target) &&
        hamburgerRef.current &&
        !hamburgerRef.current.contains(event.target)
      ) {
        setIsOpen(false);
      }
      if (
        accountMenuOpen &&
        accountRef.current &&
        !accountRef.current.contains(event.target)
      ) {
        setAccountMenuOpen(false);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, [isOpen, accountMenuOpen]);

  const handleLogin = () => {
    navigate("/volunteer-login");
  };

  const handleLogout = () => {
    setUser(null);
    setAccountMenuOpen(false);
    navigate("/"); // po wylogowaniu
  };

  const toggleAccountMenu = () => {
    setAccountMenuOpen(!accountMenuOpen);
  };

  return (
    <header className="header">
      <div className="header-container">
        <Link to="/" className="logo">
          <img src="/img/logo.png" alt="Adoptuj Przyjaciela" />
        </Link>

        {/* Nawigacja */}
        <nav ref={navRef} className={`nav ${isOpen ? "open" : ""}`}>
          <Link to="/zwierzaki-do-adopcji">Zwierzaki do adopcji</Link>
          <Link to="/czas-ze-zwierzakiem">Czas ze zwierzakiem</Link>
          <Link to="/help">Jak pomÃ³c?</Link>
          <Link to="/wolontariat">Wolontariat</Link>
          <Link to="/blog">Blog</Link>
          <Link to="/o-nas">O nas</Link>
          <Link to="/kontakt">Kontakt</Link>

          {/* Mobile login w menu hamburger */}
          {!user && (
            <button className="login-btn mobile-login" onClick={handleLogin}>
              Zaloguj
            </button>
          )}
        </nav>

        {/* Desktop login / moje konto */}
        <div className="desktop-login" ref={accountRef}>
          {user ? (
            <div className="account-wrapper">
              <button className="login-btn" onClick={toggleAccountMenu}>
                <span className="user-icon">ðŸ‘¤</span> Moje konto
              </button>
              {accountMenuOpen && (
                <div className="account-menu">
                  <Link to="/volunteer-dashboard">Informacje</Link>
                  <Link to="/volunteer-dashboard/settings">Ustawienia</Link>
                  <button onClick={handleLogout}>Wyloguj</button>
                </div>
              )}
            </div>
          ) : (
            <button className="login-btn" onClick={handleLogin}>
              Zaloguj
            </button>
          )}
        </div>

        {/* Hamburger */}
        <div
          ref={hamburgerRef}
          className={`hamburger ${isOpen ? "open" : ""}`}
          onClick={() => setIsOpen(!isOpen)}
        >
          <div></div>
          <div></div>
          <div></div>
        </div>

        {isOpen && <div className="nav-overlay" onClick={() => setIsOpen(false)} />}
      </div>
    </header>
  );
};

export default Header;
